import 'dart:ffi';import 'package:freezed_annotation/freezed_annotation.dart';part 'ChallanRequest.freezed.dart';part 'ChallanRequest.g.dart';// submit challan@Freezed()class ChallanRequest with _$ChallanRequest {  const factory ChallanRequest(      { @JsonKey(name: 'LoginID') required String loginId,        @JsonKey(name: 'OffenceHolderTypeID') required String offenceHolderTypeId,        @JsonKey(name: 'OffenceHolderName') required String offenceHolderName,        @JsonKey(name: 'MobileNumber') required String mobileNumber,        @JsonKey(name: 'EmailID') required String emailId,        @JsonKey(name: 'TradeLicenceNumber') required String tradeLicenseNumber,        @JsonKey(name: 'WingID') required String wingId,        @JsonKey(name: 'OffenceID') required String offenceId,        @JsonKey(name: 'MetrixID') required String metrixId,        @JsonKey(name: 'Amount') required String amount,        @JsonKey(name: 'OffencePhoto') required String offencePhoto,        @JsonKey(name: 'Latitude') required String latitude,        @JsonKey(name: 'Longitude') required String longitude,        @JsonKey(name: 'Address') required String address,        @JsonKey(name: 'OffenderAddress') required String offenderAddress,        @JsonKey(name: 'PaymentMode') required String paymentMode,        @JsonKey(name: 'SystemIP') required String systemIP,        @JsonKey(name: 'NoofOffences') required String noofoffence,        @JsonKey(name: 'OffencePhoto1') required String offencephoto1,        @JsonKey(name: 'OffencePhoto2') required String offencephoto2,        @JsonKey(name: 'VehicleNumber') required String vehicleno ,        @JsonKey(name: 'ChallanRemarks') required String challanremarks ,      }) = _ChallanRequest;  factory ChallanRequest.fromJson(Map<String, dynamic> json) =>      _$ChallanRequestFromJson(json);}//submit challan temp  request@freezedclass ChallanTempRequest with _$ChallanTempRequest {  const factory ChallanTempRe